import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import "../styles/Dashboard.css";
import CategoryList from "./CategoryList";  // Import the CategoryList component


const Dashboard = () => {
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    setTimeout(() => {
      setIsLoading(false); // Simulate loading delay
    }, 3000);
  }, []);

  const handleLogout = () => {
    // Handle logout logic
    navigate("/login");
  };

  return (
    <div>
      {isLoading && (
        <div className="preloader">
          <div className="spinner"></div>
        </div>
      )}

      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top shadow-lg">
        <div className="container">
          <a className="navbar-brand fw-bold fs-3 logo" href="#">E-Mart</a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
            aria-controls="navbarNav"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse justify-content-between" id="navbarNav">
            <ul className="navbar-nav mx-auto">
              <li className="nav-item"><a className="nav-link active fs-5 px-3" href="#">Home</a></li>
              <li className="nav-item"><a className="nav-link fs-5 px-3" href="#">Products</a></li>
              <li className="nav-item"><a className="nav-link fs-5 px-3" href="#">Categories</a></li>
              <li className="nav-item"><a className="nav-link fs-5 px-3" href="#">Orders</a></li>
              <li className="nav-item"><a className="nav-link fs-5 px-3" href="#">Contact</a></li>
            </ul>
            <button className="btn btn-light fw-bold" onClick={handleLogout}>Logout</button>
          </div>
        </div>
      </nav>

      {/* Category List - Display below Navbar */}
      <div className="mt-5 pt-5">
        <CategoryList />
      </div>

      {/* Hero Section */}
      <div className="hero-section">
        <div id="carouselExampleControls" className="carousel slide" data-bs-ride="carousel">
          <div className="carousel-inner">
            <div className="carousel-item active">
              <img src="https://via.placeholder.com/1500x500" className="d-block w-100" alt="Slide 1" />
              <div className="carousel-caption d-none d-md-block">
                <h2>Featured Products</h2>
                <p>Shop the latest and trending items</p>
                <a href="#" className="hero-btn btn btn-primary">Shop Now</a>
              </div>
            </div>
            <div className="carousel-item">
              <img src="https://via.placeholder.com/1500x500" className="d-block w-100" alt="Slide 2" />
              <div className="carousel-caption d-none d-md-block">
                <h2>Best Deals</h2>
                <p>Grab amazing offers on top products</p>
                <a href="#" className="hero-btn btn btn-primary">Explore</a>
              </div>
            </div>
          </div>
          <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="prev">
            <span className="carousel-control-prev-icon" aria-hidden="true"></span>
            <span className="visually-hidden">Previous</span>
          </button>
          <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="next">
            <span className="carousel-control-next-icon" aria-hidden="true"></span>
            <span className="visually-hidden">Next</span>
          </button>
        </div>
      </div>
    </div>
  );

};

export default Dashboard;
